<!DOCTYPE html>
<html lang="es">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Panel de Administrador</title>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css" rel="stylesheet"
        integrity="sha384-QWTKZyjpPEjISv5WaRU9OFeRpok6YctnYmDr5pNlyT2bRjXh0JMhjY6hW+ALEwIH" crossorigin="anonymous">
    <link rel="stylesheet" href="stylesadmin.css">



    <script>
        function checkAuth() {
            const user = JSON.parse(localStorage.getItem('user'));

            if (!user || user.role !== 'admin') {
                alert('No tienes acceso a esta página.');
                window.location.href = 'login.html'; // Redirigir a la página de login
            }
        }

        window.onload = checkAuth;
    </script>
</head>

<body>
    <nav class="navbar navbar-dark bg-primary">
        <div class="container-fluid">
            <a class="navbar-brand">Bienvenido al Panel de Administrador</a>
            <div>
                <button onclick="toggleAdmin()" type="button" class="btn btn-primary">Desbloquear</button>
                <button onclick="toggleAdmin()" type="button" class="btn btn-primary">Bloquear</button>
                <button onclick="generarPDF()" type="button" class="btn btn-primary">Descargar Resumen en PDF</button>
            </div>

            <button onclick="logout()" class="btn btn-outline-light" type="submit">Cerrar sesión</button>

        </div>
    </nav>
    <div class="sidebar">
        <div class="card text-bg-primary mb-3 " style="max-width: 18rem;">
            <div class="card-header">Header</div>
            <div class="card-body">
                <h5 class="card-title">Primary card title</h5>
                <div>
                    <p>Vendidas: <span id="vendidas">0</span></p>
                    <p>Disponibles: <span id="disponibles">0</span></p>
                    <p>Reservadas: <span id="reservadas">0</span></p>
                </div>
            </div>
        </div>
    </div>
